Episode Title: &quot;Minor's DUI Alcohol Run!; Brother-Sister Squabble; Pool Table Comes Between Exes&quot;
Episode Order: Season 18, Episode 89
Original Air Date: December 02, 2013

&quot;A minor denies destroying a friend's car after being arrested for DUI; a down-on-his-luck brother says his sister owes him money for helping her get a divorce; a woman sues her ex-lover for the return of a pool table.&quot;

Seed and enjoy! Happy December!
